import React from 'react';
import styles from './Billboard.module.css';
import cloneimg from './assets/cloneimg.webp';
import cloneBillboardTitle from './assets/cloneBillboardTitle.webp';
const Billboard = () => {

    return (
        <div className={styles.billboard}>
            <div className={styles.innerbillboard}>
                <img src ={cloneimg} alt="The Blind Side" />
                <div className={styles.title}>
                <img src ={cloneBillboardTitle} alt="The Blind Side" />
                </div>
           </div>

        </div>
    );
};

export default Billboard;
